pragma solidity 0.5.8;

contract Restv1 {

    event LogNewProvableQuery(string _description);

    struct Queuevalues {
        string phoneNumber;
        string amount;
        bytes32 queryId;
    }

    mapping (address=>Queuevalues) internal Queuemap;
    address[] queueArray;


    function _callback(bytes32 myid) public {

    }

    function _push(string memory _number,string memory _amount) public {
        Queuevalues storage queue = Queuemap[msg.sender];
        address[] storage arr = queueArray;
        queue.phoneNumber = _number;
        queue.amount = _amount;
        arr.push(msg.sender);

    }

}
